  "inlineSchema": "generator client {\n  provider      = \"prisma-client-js\"\n  binaryTargets = [\"native\", \"debian-openssl-1.0.x\"]\n}\n\ndatasource db {\n  provider = \"mysql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// Empresa/Tenant principal\nmodel Company {\n  id        String   @id @default(uuid())\n  name      String\n  logo      String?\n  address   String?\n  phone     String?\n  email     String?\n  timezone  String   @default(\"America/Mexico_City\")\n  currency  String   @default(\"MXN\")\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  locations Location[]\n  users     User[]\n  positions Position[]\n\n  @@map(\"companies\")\n}\n\n// Sucursales/Locaciones\nmodel Location {\n  id             String   @id @default(uuid())\n  companyId      String\n  name           String\n  address        String?\n  phone          String?\n  email          String?\n  timezone       String   @default(\"America/Mexico_City\")\n  isHeadquarters Boolean  @default(false) // Si es la central\n  isActive       Boolean  @default(true)\n  clockToken     String?  @unique @default(uuid()) // Token unico para acceso del reloj de asistencia\n  createdAt      DateTime @default(now())\n  updatedAt      DateTime @updatedAt\n\n  company       Company        @relation(fields: [companyId], references: [id], onDelete: Cascade)\n  shifts        Shift[]\n  timesheets    Timesheet[]\n  userLocations UserLocation[]\n\n  @@map(\"locations\")\n}\n\n// Usuarios/Empleados\nmodel User {\n  id         String   @id @default(uuid())\n  companyId  String\n  email      String   @unique\n  password   String\n  firstName  String\n  lastName   String\n  phone      String?\n  avatar     String?\n  pin        String? // PIN de 4 digitos para marcar asistencia\n  role       Role     @default(EMPLOYEE)\n  isActive   Boolean  @default(true)\n  canViewAll Boolean  @default(false) // Puede ver todas las sucursales\n  createdAt  DateTime @default(now())\n  updatedAt  DateTime @updatedAt\n\n  company          Company          @relation(fields: [companyId], references: [id], onDelete: Cascade)\n  userLocations    UserLocation[]\n  userPositions    UserPosition[]\n  shifts           Shift[]\n  timesheets       Timesheet[]\n  timeOffRequests  TimeOffRequest[]\n  approvedRequests TimeOffRequest[] @relation(\"ApprovedBy\")\n\n  @@map(\"users\")\n}\n\nenum Role {\n  SUPER_ADMIN // Puede ver y gestionar todo\n  ADMIN // Admin de la empresa\n  MANAGER // Manager de sucursal(es)\n  SUPERVISOR // Supervisor\n  EMPLOYEE // Empleado regular\n}\n\n// Relacion Usuario-Ubicacion (a que sucursales tiene acceso)\nmodel UserLocation {\n  id         String   @id @default(uuid())\n  userId     String\n  locationId String\n  isPrimary  Boolean  @default(false) // Sucursal principal del empleado\n  createdAt  DateTime @default(now())\n\n  user     User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n  location Location @relation(fields: [locationId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, locationId])\n  @@map(\"user_locations\")\n}\n\n// Puestos/Cargos\nmodel Position {\n  id          String   @id @default(uuid())\n  companyId   String\n  name        String\n  description String?\n  color       String   @default(\"#3B82F6\") // Color para el calendario\n  hourlyRate  Decimal? @db.Decimal(10, 2)\n  isActive    Boolean  @default(true)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  company       Company        @relation(fields: [companyId], references: [id], onDelete: Cascade)\n  userPositions UserPosition[]\n  shifts        Shift[]\n\n  @@map(\"positions\")\n}\n\n// Relacion Usuario-Posicion\nmodel UserPosition {\n  id         String   @id @default(uuid())\n  userId     String\n  positionId String\n  createdAt  DateTime @default(now())\n\n  user     User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n  position Position @relation(fields: [positionId], references: [id], onDelete: Cascade)\n\n  @@unique([userId, positionId])\n  @@map(\"user_positions\")\n}\n\n// Turnos\nmodel Shift {\n  id           String      @id @default(uuid())\n  locationId   String\n  userId       String? // Null si es OpenShift\n  positionId   String? // Null si es DayOff\n  date         DateTime    @db.Date\n  startTime    DateTime?   @db.Time(0) // Null si es DayOff\n  endTime      DateTime?   @db.Time(0) // Null si es DayOff\n  breakMinutes Int         @default(0)\n  notes        String?     @db.Text\n  status       ShiftStatus @default(SCHEDULED)\n  isOpenShift  Boolean     @default(false) // Turno disponible para tomar\n  isPublished  Boolean     @default(false)\n  isDayOff     Boolean     @default(false) // Es dia libre\n  dayOffType   DayOffType? // Tipo de dia libre\n  isPaid       Boolean     @default(true) // Si es pagado o no\n  createdAt    DateTime    @default(now())\n  updatedAt    DateTime    @updatedAt\n\n  location  Location   @relation(fields: [locationId], references: [id], onDelete: Cascade)\n  user      User?      @relation(fields: [userId], references: [id], onDelete: SetNull)\n  position  Position?  @relation(fields: [positionId], references: [id], onDelete: Cascade)\n  timesheet Timesheet?\n\n  @@index([locationId, date])\n  @@index([userId, date])\n  @@map(\"shifts\")\n}\n\nenum DayOffType {\n  DAY_OFF // Franco/Dia libre regular\n  SICK // Enfermedad\n  VACATION // Vacaciones\n  HOLIDAY // Festivo/Feriado\n  PERSONAL // Asunto personal\n  MATERNITY // Maternidad\n  PATERNITY // Paternidad\n  BEREAVEMENT // Duelo\n  UNPAID_LEAVE // Licencia sin goce\n  OTHER // Otro\n}\n\nenum ShiftStatus {\n  SCHEDULED // Programado\n  CONFIRMED // Confirmado por empleado\n  IN_PROGRESS // En curso\n  COMPLETED // Completado\n  CANCELLED // Cancelado\n  NO_SHOW // No se presento\n}\n\n// Registro de tiempo (Asistencia)\nmodel Timesheet {\n  id           String          @id @default(uuid())\n  shiftId      String?         @unique\n  locationId   String\n  userId       String\n  date         DateTime        @db.Date\n  clockIn      DateTime?\n  clockOut     DateTime?\n  breakStart   DateTime?\n  breakEnd     DateTime?\n  totalMinutes Int?\n  status       TimesheetStatus @default(PENDING)\n  notes        String?         @db.Text\n  approvedBy   String?\n  approvedAt   DateTime?\n  createdAt    DateTime        @default(now())\n  updatedAt    DateTime        @updatedAt\n\n  shift    Shift?   @relation(fields: [shiftId], references: [id], onDelete: SetNull)\n  location Location @relation(fields: [locationId], references: [id], onDelete: Cascade)\n  user     User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([locationId, date])\n  @@index([userId, date])\n  @@map(\"timesheets\")\n}\n\nenum TimesheetStatus {\n  PENDING // Pendiente\n  SUBMITTED // Enviado para aprobar\n  APPROVED // Aprobado\n  REJECTED // Rechazado\n}\n\n// Solicitudes de tiempo libre\nmodel TimeOffRequest {\n  id             String        @id @default(uuid())\n  userId         String\n  type           TimeOffType\n  startDate      DateTime      @db.Date\n  endDate        DateTime      @db.Date\n  reason         String?       @db.Text\n  status         TimeOffStatus @default(PENDING)\n  approvedById   String?\n  approvedAt     DateTime?\n  rejectedReason String?\n  createdAt      DateTime      @default(now())\n  updatedAt      DateTime      @updatedAt\n\n  user       User  @relation(fields: [userId], references: [id], onDelete: Cascade)\n  approvedBy User? @relation(\"ApprovedBy\", fields: [approvedById], references: [id], onDelete: SetNull)\n\n  @@index([userId, status])\n  @@map(\"time_off_requests\")\n}\n\nenum TimeOffType {\n  VACATION // Vacaciones\n  SICK // Enfermedad\n  PERSONAL // Personal\n  MATERNITY // Maternidad\n  PATERNITY // Paternidad\n  BEREAVEMENT // Duelo\n  OTHER // Otro\n}\n\nenum TimeOffStatus {\n  PENDING // Pendiente\n  APPROVED // Aprobado\n  REJECTED // Rechazado\n  CANCELLED // Cancelado\n}\n",
